import React from 'react';
import './App.css';
import Main from './components/main.js'
import NavBar from './components/navigation.js'
import { Button } from 'react-bootstrap';
import fb from './assets/fb.png'

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: '',
      name: '',
      email: '',
      picture:'',
      status: 'Log in With Facebook'
    };
  }

  componentDidMount=()=>{
    window.fbAsyncInit = ()=> {
      window.FB.init({
        appId      : '2854741097907041',
        cookie     : true,                     // Enable cookies to allow the server to access the session.
        xfbml      : true,                     // Parse social plugins on this webpage.
        version    : 'v6.1'           // Use this Graph API version for this call.
      });

      (function(d, s, id) {
        var js, fjs = d.getElementsByTagName(s)[0];
        if (d.getElementById(id)) return;
        js = d.createElement(s); js.id = id;
        js.src = "//connect.facebook.net/en_US/sdk.js#xfbml=1&version=v2.8&appId=YOUR-APP'S-ID";
        fjs.parentNode.insertBefore(js, fjs);
      }(document, 'script', 'facebook-jssdk'));

    }
  }

  handleModalShow=()=>{
    this.setState({ modalShow: true})
    console.log("modal")
  }

  render(){

    return (
    <div >
      <NavBar 
        handleModalShow={this.handleModalShow}
      />
      {/* <Main/> */}
      <div class="fb-login-button" data-size="medium" data-auto-logout-link="true" data-onlogin={this.checkLoginState}></div>
      </div> 

    );

  }
}
